import React from "react";

//components
import Header from "../components/Header";
import Loading from "../components/Spinner";


//hooks
import { useHomeFetch } from "../hooks/getPokemonPage";


const Home = () => {
    const { state, loading, error } = useHomeFetch();
    return (
        <>
            <Header />
            {loading && <Loading />}
        </>
    )
}

export default Home;
